script: |
  super -f text -I q3232.spq | sort > q3232.out

inputs:
  - name: q3232.spq
    data: |
      SELECT DISTINCT col0 * col0 * - col1 - - col1 * cor0.col0 AS col0 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q3232.out
    data: |
      -104754
      -1302
      -354354
